DROP TABLE IF EXISTS `benutzer`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `benutzer` (
  `benutzer_id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Primärschlüssel.',
  `benutzername` varchar(45) NOT NULL COMMENT 'Name des Benutzers.\n\nBeispiel: Vorname Familienname',
  `passwort` varchar(255) NOT NULL COMMENT 'Kryptografische Hash des Benutzer Passwortes. Wird anfanglich durch den manager Rolle zugewiesen. Danach wird es durch den Benutzer bei Bedarf selbst gesetzt.',
  `benutzer_geburtstag` date DEFAULT NULL COMMENT 'Geburtstag des Benutzers (Format: jjjj-mm-tt).',
  `benutzer_telefon` varchar(128) DEFAULT NULL COMMENT 'Telefon Nummern (Fixnet und oder Mobile) des Benutzers.',
  `benutzer_anschrift` text COMMENT 'Anschrift des Benutzers: Anrede, Vorname, Name, Strasse/Nummer, PLZ/Ortsname',
  `benutzer_notfall` text COMMENT 'Notfall Angaben für den Benutzer: wer / wem soll benachrichtigt werden im Falle eines persönlichen Notfalles.',
  `ist_manager` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'Hat der Benutzer die Manager Rolle (1) oder nicht (0). Die Manager Rolle kann alle Funktionen der Applikation nutzen.',
  `ist_disponent` tinyint(4) NOT NULL DEFAULT '1' COMMENT 'Hat der Benutzer die Disponent Rolle (1) oder nicht (0). Die Disponent Rolle kann eine vorbestimmte Auswahl der Funktionen in  der Applikation nutzen.',
  `ist_aktive` tinyint(4) NOT NULL DEFAULT '1' COMMENT 'Ist der Benutzer aktive (1) oder nicht (0). Wegen die Wahrung der  referentielle Integrität können oft Objekte in der Datenbank nicht gelöscht werden. Diese Objekte werden dann "ist_aktiev = 0" gesetzt.',
  `memo` text COMMENT 'Vertrauliche Notizen zum Benutzer. ACHTUNG: kann von alle Personen mit Manager Rolle gelesen werden. Daher sollte man oder Frau vorsichtig sein mit dem was hier festgehalten wird.',
  PRIMARY KEY (`benutzer_id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=latin1 COMMENT='Tabelle mit iTixi Benutzer: Managers, Disponenten ...';
/*!40101 SET character_set_client = @saved_cs_client */;

