DROP TABLE IF EXISTS `fahrzeug`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `fahrzeug` (
  `fahrzeug_id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Primary Key in Tabelle Fahrzeug.',
  `fahrzeugname` varchar(45) NOT NULL COMMENT 'Eindeutuge Name des Fahrzeuges, z.B. VW MAXI 1 (Wagenmarke Fahrzeugtype und Laufnummer).',
  `ist_aktive` tinyint(1) NOT NULL DEFAULT '1' COMMENT 'Ist das Fahrzeug noch aktive. Wenn Fahrzeuge ausgemustert werden soll aktive = false gesetzt werden. Wegen referentielle Integrität kann der Datensatz wahrscheinlich erst später gelöscht werden.',
  `kennzeichen` varchar(45) DEFAULT NULL COMMENT 'Amtliches Kennzeichen des Fahrzeuges.',
  `inverkehrsetzung` date DEFAULT NULL COMMENT 'Inverkehrsetzungs Datum, gemäss amtliches Fahrzeugausweis.',
  `anzahl_sitze` int(11) NOT NULL DEFAULT '4' COMMENT 'Anzahl Sitze über dem das Fahrzeug verfügt, inklusive Fahrersitz.  Ausgeschlossen sind allfällige Rollstuhlplätze.',
  `anzahl_rollstuehle` int(11) NOT NULL DEFAULT '1' COMMENT 'Anzahl Rollstühle die das Fahrzeug transportieren kann.',
  `parkplatz_bezeichnung` varchar(45) DEFAULT NULL COMMENT 'Bezeichnung des Parkplatzes, das für diese Fahrzeug reserviert ist.',
  `fahrzeugbetreuer` varchar(45) DEFAULT NULL COMMENT 'Name des Fahrzeugbetreuers dieses Fahrzeuges.',
  `memo` text COMMENT 'Notizen zum Fahrzeug.',
  `fahrzeug_details` mediumtext COMMENT 'Vertrauliche Daten zum Fahrzeug. Kann nur durch die Rolle ROLE_ADMIN gelesen und geschrieben werden.',
  PRIMARY KEY (`fahrzeug_id`),
  UNIQUE KEY `fahrzeugname_UNIQUE` (`fahrzeugname`),
  UNIQUE KEY `kennzeichen_UNIQUE` (`kennzeichen`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1 COMMENT='Tabelle mit alle Fahrzeuge des TIXI Betriebes.';
/*!40101 SET character_set_client = @saved_cs_client */;

