CREATE TABLE `ovi` (
  `ovi_id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID in Tabelle mit OVI-Daten. \nOVI = Orte Von Interesse.',
  `ovi_anschrift_fk` int(11) NOT NULL,
  `pin` int(11) DEFAULT NULL COMMENT 'PIN: Dies ist der ID des Objektes in der Ursprungs-Datenbank, vor der Daten-Migration.',
  `ist_aktive` tinyint(1) NOT NULL DEFAULT '1' COMMENT 'Ist die Ort von Interesse aktive oder nicht (es kann ein Umzug Stattgefunden haben).\n\nWertbereich: Ja/Nein, TRUE/FALSE.',
  `statistik` varchar(255) DEFAULT NULL COMMENT 'Keine, eine oder mehrere Kennwörter damit Statistiken aus Fahrten gewonnen werden können. Diese Statistiken werden für nachweise für Subventionen benötigt.\n\nBeispiele: Medizin, Spital, Klinik, Therapie, Arztpraxis, privat, Einkaufen, Ausgang, Restaurant, Kino, etc. Maximal 255 Zeichen.',
  `ovi_name` varchar(45) NOT NULL COMMENT 'Name der Einrichtung.\n\nBeispiel: Kantonsspital Zug',
  `abteilung_name` varchar(45) DEFAULT NULL COMMENT 'Name der Abteilung.\n\nBeispiel: Dialyse',
  `telefonnummer` varchar(45) DEFAULT NULL COMMENT 'Telefonnummer des OVI (Einrichtung oder Abteilung).\n\nBeispiel: 041 399 41 10',
  `bemerkung` varchar(255) DEFAULT NULL COMMENT 'Bemerkung(en) zu der OVI, die in den Fahrauftrag gedruckt werden. Verdeutlicht bestimmten OVI-/ Einrichtung-/ Abteilungs-eigenschaften.\n\nBeispiel: > Immer melden am Empfang\nSpitze Klammern zur Abgrenzung von mehrere Zeilen!',
  `memo` text,
  `ovi_details` mediumtext COMMENT 'Vertrauliche Daten betreffend den OVI.',
  PRIMARY KEY (`ovi_id`),
  KEY `ovi_anschrift_idx` (`ovi_anschrift_fk`),
  CONSTRAINT `ovi_anschrift_constraint` FOREIGN KEY (`ovi_anschrift_fk`) REFERENCES `anschrift` (`anschrift_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=382 DEFAULT CHARSET=latin1 COMMENT='Tabelle mit Orte von Interesse. Dies sind alle Adressen die von TIXI Mitglieder angefahren werden können.\nBespiele: Spitäler, Kliniken, Arztpraxen, aber auch Shopping Zentren, Läden, Restaurants etc.';
